import AvatarComponent from './avatar.styled'
import Image from 'next/image'

function Avatar () {
  return(
    <a href="/">
      <figure>
        <Image 
          src="/eu.jpg" 
          alt="Foto do Danilo de Perfil olhando para baixo"
          width={60}
          height={60}
        />
      </figure>
    </a>
  )
}

export default Avatar
